INSERT INTO `trip` VALUES (1,'武汉一日游','','交友, 畅聊',420100,420100,'2017-08-19 00:00:00','2017-08-20 00:00:00',4,2,NULL,NULL,NULL,2,NULL,NULL,'旅游，搞起，一起玩，一起嗨，大口吃肉，大碗喝酒，完美！'),(2,'桂林三日游','','风景美, 人美, 各种美',420100,450300,'2017-08-26 00:00:00','2017-08-27 00:00:00',4,2,NULL,1,1,2,NULL,NULL,'桂林山水甲天下，山美，水美，人更美。旅游， 玩耍，开心！'),(3,'张家界三日游','','张家界, 砂岩峰林, 森林公园',420100,430800,'2017-08-18 00:00:00','2017-08-21 00:00:00',2,1,NULL,1,1,1,NULL,NULL,'张家界特有的石英砂岩峰林地貌，使得张家界森林公园形成了雄奇与秀美兼具的独特景观，园内3000多座石峰，与繁盛的植被，缭绕的云海，共同构成一个宛如仙境的神奇王国。张家界也因此被著名导演卡梅隆选中，做为风靡全球的电影《阿凡达》的主要取景地，电影中那个美丽、神奇的潘多拉星球，主要的原型即是张家界森林公园。');
/*!40000 ALTER TABLE `trip` ENABLE KEYS */;
UNLOCK TABLES;

